      out.write("\r\n");
      out.write("\t\t///// Animation Chart ///////////////////////////\r\n");
      out.write("\t\t//var speed = 3;\r\n");
      out.write("\t\tfunction animateChart() {\r\n");
      out.write("\t\t\trequestId = window.requestAnimationFrame(animateChart);\r\n");
      out.write("\t\t\tframes += speed; //console.log(frames)\r\n");
      out.write("\t\t\tctx.clearRect(60, 0, cw, ch - 60);\r\n");
      out.write("\r\n");
      out.write("\t\t\tfor (var i = 0; i < oFlat.length; i++) {\r\n");
