      out.write("\r\n");
      out.write("\t\t//CURVATURE\r\n");
      out.write("\t\tfunction controlPoints(p) {\r\n");
      out.write("\t\t\t// given the points array p calculate the control points\r\n");
      out.write("\t\t\tvar pc = [];\r\n");
      out.write("\t\t\tfor (var i = 1; i < p.length - 1; i++) {\r\n");
      out.write("\t\t\t\tvar dx = p[i - 1].x - p[i + 1].x; // difference x\r\n");
      out.write("\t\t\t\tvar dy = p[i - 1].y - p[i + 1].y; // difference y\r\n");
      out.write("\t\t\t\t// the first control point\r\n");
      out.write("\t\t\t\tvar x1 = p[i].x - dx * t;\r\n");
      out.write("\t\t\t\tvar y1 = p[i].y - dy * t;\r\n");
      out.write("\t\t\t\tvar o1 = {\r\n");
      out.write("\t\t\t\t\tx : x1,\r\n");
      out.write("\t\t\t\t\ty : y1\r\n");
      out.write("\t\t\t\t};\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t// the second control point\r\n");
      out.write("\t\t\t\tvar x2 = p[i].x + dx * t;\r\n");
      out.write("\t\t\t\tvar y2 = p[i].y + dy * t;\r\n");
      out.write("\t\t\t\tvar o2 = {\r\n");
      out.write("\t\t\t\t\tx : x2,\r\n");
      out.write("\t\t\t\t\ty : y2\r\n");
      out.write("\t\t\t\t};\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t// building the control points array\r\n");
      out.write("\t\t\t\tpc[i] = [];\r\n");
      out.write("\t\t\t\tpc[i].push(o1);\r\n");
      out.write("\t\t\t\tpc[i].push(o2);\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\t\t\treturn pc;\r\n");
      out.write("\t\t}\r\n");
      out.write("\r\n");
      out.write("\t\tfunction drawCurve(p) {\r\n");
      out.write("\r\n");
      out.write("\t\t\tvar pc = controlPoints(p); // the control points array\r\n");
      out.write("\r\n");
      out.write("\t\t\tctx.beginPath();\r\n");
      out.write("\t\t\t//ctx.moveTo(p[0].x, B.y- 25);\r\n");
      out.write("\t\t\tctx.lineTo(p[0].x, p[0].y);\r\n");
      out.write("\t\t\t// the first & the last curve are quadratic Bezier\r\n");
      out.write("\t\t\t// because I'm using push(), pc[i][1] comes before pc[i][0]\r\n");
      out.write("\t\t\tctx.quadraticCurveTo(pc[1][1].x, pc[1][1].y, p[1].x, p[1].y);\r\n");
      out.write("\r\n");
      out.write("\t\t\tif (p.length > 2) {\r\n");
      out.write("\t\t\t\t// central curves are cubic Bezier\r\n");
      out.write("\t\t\t\tfor (var i = 1; i < p.length - 2; i++) {\r\n");
      out.write("\t\t\t\t\tctx.bezierCurveTo(pc[i][0].x, pc[i][0].y, pc[i + 1][1].x,\r\n");
      out.write("\t\t\t\t\t\t\tpc[i + 1][1].y, p[i + 1].x, p[i + 1].y);\r\n");
      out.write("\t\t\t\t}\r\n");
      out.write("\t\t\t\t// the first & the last curve are quadratic Bezier\r\n");
      out.write("\t\t\t\tvar n = p.length - 1;\r\n");
      out.write("\t\t\t\tctx.quadraticCurveTo(pc[n - 1][0].x, pc[n - 1][0].y, p[n].x,\r\n");
      out.write("\t\t\t\t\t\tp[n].y);\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\r\n");
      out.write("\t\t\t//ctx.lineTo(p[p.length-1].x, B.y- 25);\r\n");
      out.write("\t\t\tctx.stroke();\r\n");
      out.write("\t\t\tctx.save();\r\n");
      out.write("\t\t\tctx.fillStyle = grd;\r\n");
      out.write("\t\t\tctx.fill();\r\n");
      out.write("\t\t\tctx.restore();\r\n");
      out.write("\t\t}\r\n");
      out.write("\r\n");
      out.write("\t\tfunction arrayMax(array) {\r\n");
      out.write("\t\t\treturn Math.max.apply(Math, array);\r\n");
      out.write("\t\t};\r\n");
      out.write("\r\n");
      out.write("\t\tfunction arrayMin(array) {\r\n");
      out.write("\t\t\treturn Math.min.apply(Math, array);\r\n");
      out.write("\t\t};\r\n");
      out.write("\r\n");
      out.write("\t\tfunction oMousePos(canvas, evt) {\r\n");
      out.write("\t\t\tvar ClientRect = canvas.getBoundingClientRect();\r\n");
      out.write("\t\t\treturn { //objeto\r\n");
      out.write("\t\t\t\tx : Math.round(evt.clientX - ClientRect.left),\r\n");
      out.write("\t\t\t\ty : Math.round(evt.clientY - ClientRect.top)\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\t\t}\r\n");
      out.write("\t</script>\r\n");
      out.write("\t<!-- hoa don -->\r\n");
      out.write("\t<script type=\"text/javascript\">\r\n");
